import React from 'react';
import lineImage from './image/line.jpeg';
import Created from './Created';

class CreatedData extends React.Component{
    render(){

        const createdData = [
            {
                id: "1",
                name: "Lineのクローンアプリ",
                image: {lineImage},
                introduction: "Lineようなチャットアプリ。Firebaseを利用してのチャットアプリでデザインをなるべくLineに寄せて実装しました",
                url: "git@github.com:KeiNakamur/chatapp-react.git",
            },
            {
                id: "2",
                name: "Todoアプリ",
                image: "",
                introduction: "簡易的なTodoアプリです。簡易的なのでデザインは適当です",
                url: "git@github.com:KeiNakamur/react-todo-app.git"
            },
            {
                id: "3",
                name: "pixabayのクローンアプリ",
                image: "",
                introduction: "Pixabayのような写真検索アプリを実装しました",
                url: "git@github.com:KeiNakamur/react-pixer.git"
            },
            {
                id: "4",
                name: "検索アプリ(検索機能のみ)",
                image: "",
                introduction: "検索機能をどのように実装するのかを確かめるために実装しました",
                url: "git@github.com:KeiNakamur/searchbox-react.git"
            }
        ]

        return(
            <div>
                {createdData.map((data) => {
                    <Created 
                        name={data.name}
                        image={data.image}
                        introduction={data.introduction}
                        url={data.url}
                    />
                })}
            </div>
        )
    }
}

export default CreatedData;
